using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class StructureGirderInputModel : Notifier	{		public StructureGirderInputModel()		{					GirderInNo = "";			GirderInSize = "";			GirderInQty = "";			GirderInRadius = "";		}				private string _GirderInNo;		public string GirderInNo			{				get { return _GirderInNo; }				set				{					_GirderInNo = value;					OnPropertyChanged(nameof(GirderInNo));				}			}				private string _GirderInSize;		public string GirderInSize			{				get { return _GirderInSize; }				set				{					_GirderInSize = value;					OnPropertyChanged(nameof(GirderInSize));				}			}				private string _GirderInQty;		public string GirderInQty			{				get { return _GirderInQty; }				set				{					_GirderInQty = value;					OnPropertyChanged(nameof(GirderInQty));				}			}				private string _GirderInRadius;		public string GirderInRadius			{				get { return _GirderInRadius; }				set				{					_GirderInRadius = value;					OnPropertyChanged(nameof(GirderInRadius));				}			}			}}